import React from "react";
import { Link } from "react-router-dom";

const User = ({ posts }) => {
  return (
    <div>
      {posts.map((user, key) => (
        <Link
          key={key}
          className="dropdown-item"
          to={{
            pathname: `/update-user/${user._id}`,
          }}
        >
          <div className="text-center "> User</div>
        </Link>
      ))}
    </div>
  );
};

export default User;
